import React from 'react';
import ReactDOM from 'react-dom'
import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

function addQuestions(){
  const JSX = (
    <head id='question'>
    <body>
      <form>
      <label>
        Question:<br/>
        <textarea type="text" rows='20' cols='70'/>
        <textarea type="text" name="name" rows='20' cols='70'/><br/>
        <input type="submit" value="Submit" />
      </label>
      </form>
    </body>
    </head>
  )
  ReactDOM.render(JSX, document.getElementById('question'));

}

function testQuestions(){
  return
}

function App() {
  return (
    <div>
      <button onClick={addQuestions()}>Add Questions</button>
      <button onClick={testQuestions()}>Test Questions</button>
    </div>
  );
}

export default App;
